import React from 'react';
const Main = () => {
  const firstName = `Steven`;
  const lastName = `Yoh`
  return (
    <div className="main-home">
     <svg width="5000" height="2000" viewBox="0 0 5000 2000" fill="none" xmlns="http://www.w3.org/2000/svg">
<g id="backdrop">
<path id="backdrop-solid" d="M5000 0H0V2000H5000V0Z" fill="#6C63FF"/>
<path id="backdrop-shadow" opacity="0.1" d="M5000 2000H0V427L5000 2000Z" fill="black"/>
</g>
</svg>


        <p>{firstName}</p>
        <p>{lastName}</p>
    </div>
  )
}

export default Main;
